import React from "react";
import { NavLink } from "react-router-dom";

const NavBar = () => {
  return (
    <nav className="navbar navbar-expand-lg no-gutter fluid d-flex  nav-bar">
        <div class="container-fluid">
      <NavLink to="/movieList" className="logo text-warning navbar-brand">Filimo</NavLink>
      <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
      <span className="navbar-toggler-icon"></span>
    </button>
    <div className="collapse navbar-collapse" id="navbarSupportedContent">
    <ul class="navbar-nav me-auto mb-2 mb-lg-0 bg-danger">
        <li class="nav-item">
          <NavLink className="nav-link active" aria-current="page" to="/movieList">Home</NavLink>
        </li>
        <li class="nav-item">
          <NavLink className="nav-link active" aria-current="page" to="/">Form</NavLink>
        </li>
        <li class="nav-item">
          <NavLink className="nav-link active" aria-current="page" to="/logreg">Sign In</NavLink>
        </li>
        </ul>
    </div>
    </div>
    </nav>
  );
};

export default NavBar;
